.header {
  width: 100%;
  position: relative;
  background: linear-gradient(
      to top,
      rgba(252, 227, 138, 0.9) 0%,
      rgba(243, 129, 129, 0.9) 100%
    ),
    url("/assets/images/header-bg.jpg") no-repeat center;
  background-size: cover;
  padding: 28px 0 230px;
  margin-bottom: 46px;

  @media (min-resolution: $large-resolution) {
    background: linear-gradient(
        to top,
        rgba(252, 227, 138, 0.9) 0%,
        rgba(243, 129, 129, 0.9) 100%
      ),
      url("/assets/images/header-bg@2x.jpg") no-repeat center;
  }

  &__burger-menu {
    z-index: 10;
    @media (min-width: 1366px) {
      display: none;
    }

    &:hover .burger-menu__icon {
      fill: $base-dark;
    }
  }

  &__sub-title {
    font-size: 72px;
    font-weight: 400;
    text-align: center;
    margin-bottom: 42px;

    @media (max-width: 1366px) {
      font-size: 36px;
    }
  }

  &__title {
    font-size: 150px;
    font-weight: 700;
    text-align: center;
    width: 802px;
    text-transform: uppercase;
    margin: 0 auto 124px;

    @media (max-width: 1366px) {
      font-size: 60px;
      width: 100%;
      margin-bottom: 62px;
    }
  }

  &__button {
    font-size: 14px;
    font-weight: 700;
    padding: 15px 33px;
    border: 3px solid $base-white;
    text-transform: uppercase;
    display: block;
    margin: 0 auto;
  }
}

sources.styles\\components\\menu\\index.scss:
.menu {
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 1096px;
  margin: 0 auto;
  margin-bottom: 164px;

  @media (max-width: 1366px) {
    margin-bottom: 82px;
    width: auto;
    padding: 0 15px;
  }

  &__tools {
    display: flex;
  }

  &__logo {
    flex: 1 1;

    @media (max-width: 1366px) {
      position: absolute;
      right: 50%;
      transform: translateX(50%);
    }
  }

  &__list {
    display: flex;
    justify-content: space-between;
    flex: 1 1;
    transition: $base-transition;

    @media (min-width: 1366px) {
      margin-right: 52px;
    }

    @media (max-width: 1366px) {
      width: 100%;
      height: 100%;
      top: 0;
      left: 0;
      position: absolute;
      align-items: center;
      justify-content: center;
      flex-direction: column;
      background-color: $base-white;
    }

    &--hidden {
      @media (max-width: 1366px) {
        transform: translateX(-100%);
      }
    }
  }

  &__item {
    @media (max-width: 1366px) {
      margin-bottom: 36px;
    }
  }

  &__link {
    color: $base-white;
    font-family: "Montserrat";
    font-size: 14px;
    font-weight: 400;
    text-transform: uppercase;
    border-bottom: 3px solid transparent;
    padding-bottom: 12px;
    transition: $base-transition;

    @media (max-width: 1366px) {
      color: $base-dark;
    }

    &:hover {
      border-color: $base-yellow;
      color: $base-yellow;
    }
  }

  &__basket {
    margin-right: 42px;

    @media (max-width: 1366px) {
      margin-right: 18px;
    }
  }
}

