.services {
  width: 1142px;
  margin: 0 auto 92px;

  @media (max-width: 1024px) {
    width: 100%;
  }

  &__section-hero {
    margin-bottom: 66px;
  }

  &__list {
    display: flex;
    flex-wrap: wrap;
    justify-content: center;

    @media (max-width: 1023px) {
      padding: 0 10px;
      justify-content: space-between;
    }
  }

  &__item {
    width: calc(33% - 68px);
    display: flex;

    @media (max-width: 1023px) {
      width: calc(45% - 16px);
    }

    @media (min-width: 1024px) {
      &:not(:nth-child(3n)) {
        margin-right: 68px;
      }
    }

    &:nth-child(-n + 3) {
      margin-bottom: 101px;
    }
  }

  &__icon {
    flex: 1 1;

    @media (max-width: 1023px) {
      margin-right: 10px;
    }
  }

  &__about {
    flex: 4 1;
  }

  &__name {
    color: $base-dark;
    font-family: "Montserrat";
    font-size: 14px;
    font-weight: 400;
    text-transform: uppercase;
    margin-bottom: 20px;
  }

  &__description {
    color: $base-grey;
    font-family: "Roboto";
    font-size: 15px;
    font-weight: 400;
  }
}

.section-hero {
  &::after {
    content: "";
    display: block;
    height: 3px;
    width: 60px;
    background-color: $base-pink;
    margin: 0 auto;
  }

  &__sub-title {
    font-size: 24px;
    color: $base-dark;
    margin-bottom: 22px;
    text-align: center;
  }

  &__title {
    color: $base-dark;
    font-size: 30px;
    font-weight: 700;
    text-align: center;
    text-transform: uppercase;
    padding-bottom: 42px;
  }
}

