.team {
  border-bottom: 1px solid #e5e5e5;
  width: $team-section-width;
  margin: 0 auto;
  padding-bottom: 82px;
  margin-bottom: 26px;

  @media (max-width: 1365px) {
    padding: 0 10px 82px;
    width: auto;
  }

  &__item {
    @media (max-width: 1365px) {
      &:not(:last-child) {
        margin-bottom: 36px;
      }
    }
  }

  &__section-hero {
    margin-bottom: 46px;
  }

  &__description {
    width: 954px;
    margin: 0 auto;
    color: $base-grey;
    font-family: "Roboto";
    font-size: 15px;
    font-weight: 400;
    text-align: center;
    margin-bottom: 82px;

    @media (max-width: 1366px) {
      width: 100%;
    }
  }

  &__list {
    width: 1210px;
    margin: 0 auto;
    display: flex;
    justify-content: space-between;
    flex-wrap: wrap;

    @media (max-width: 1365px) {
      width: 100%;
      flex-direction: column;
    }
  }

  &__name {
    color: $base-dark;
    font-family: "Montserrat";
    font-size: 14px;
    font-weight: 400;
    margin-bottom: 15px;
    text-align: center;
  }

  &__position {
    color: $base-grey;
    font-family: "Roboto";
    font-style: italic;
    font-size: 15px;
    font-weight: 300;
    text-align: center;
  }

  &__info-layer {
    transition: $base-transition;
    position: relative;
  }

  &__image {
    display: block;

    @media (max-width: 1366px) {
      margin: 0 auto;
    }
  }

  &__gradient {
    width: 100%;
    height: 100%;
    position: absolute;
    top: 0;
    left: 0;
    transition: $base-transition;
    background-image: linear-gradient(
      to top,
      rgba(252, 227, 138, 0.9) 0%,
      rgba(243, 129, 129, 0.9) 100%
    );
    opacity: 0;
  }

  &__inner {
    margin-bottom: 31px;
    transition: $base-transition;

    &:hover > .team__info-layer {
      transform: translate(-10px, -10px);
    }

    &:hover .team__gradient {
      opacity: 1;
    }

    &:hover .team__socials {
      opacity: 1;
    }

    &:hover {
      background-color: $base-green;
    }
  }

  &__socials {
    display: flex;
    z-index: 1;
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    opacity: 0;

    & > .socials__item {
      display: flex;
      align-items: center;
      justify-content: center;
      min-width: 56px;

      @media (max-width: 1366px) {
        width: 50%;
      }
    }

    & .socials__link {
      padding: 15px 0;
    }
  }
}

